import React from 'react';
// import UButton from './UButton';
// import Button from 'react-bootstrap/Button';

import BlackOutlined from './../static/images/extruder/Unite3D-extruder-black-no-background.png'
import PurpleOutlined from './../static/images/extruder/Unite3D-extruder-purple-no-background.png'
import WhiteOutlined from './../static/images/extruder/Unite3D-extruder-white-no-background.png'

export default class Unite3DLogo extends React.Component {

  constructor(props) {
    super(props);
    this.color = props.color
  }

  greeting() {
    switch(this.color) {
      case 'purple':
        return (
          <img
            alt=""
            src={PurpleOutlined}
            width="50"
            height="50"
            className="mr-2 d-inline-block align-top"
          />
        )
      case 'white':
        return (
          <img
            alt=""
            src={WhiteOutlined}
            width="50"
            height="50"
            className="mr-2 d-inline-block align-top"
          />
        )
      default:
        return (
          <img
            alt=""
            src={BlackOutlined}
            width="50"
            height="50"
            className="mr-2 d-inline-block align-top"
          />
        )
    }
  }

  render() {
    return (
      this.greeting()
    )
  }
}
